host_about:
world traveler, Spanish Cuban American establish in Madrid, after 2 years of meeting great people all over the world.

(Thanks, Nikolay Dimitrov and Unsplash for the image in my guide.
@ncipio)

Me apasiona viajar a ser posible sola para integrarme al máximo en los lugares que visito;
No importa el continente,disfruto de cada instante y son perfectos para conectar con tu momento personal
Siempre he pensado como seria sentirte en casa estando muy lejos sin necesidad de hoteles,en ocasiones impersonales y fríos,de ahí la idea de ser miembro de airbnb y compartir mi hogar con personas inquietas y aventureras que quieran disfrutar de Madrid,mi ciudad !!!en la que sin duda vais a disfrutar unos días agradables

Hola;
Soy Mario y tenemos una habitación libre junto a la estación de Chamartín.

Somos tranquilos, ordenados y muy afables. Si no te gusta la frialdad de un hostal, te invitamos a que pases con nosotros tus días en Madrid al calor de nuestra calefacción.
